  \"A Comprehensive Survey and Comparison of Breeding Habitats for the Pine Barrens
  Treefrog (Hyla andersonii) at Carolina Sandhills National Wildlife Refuge\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:19.023337\",\n\t\"name\": \"a-comprehensive-survey-and-comparison-of-breeding-habitats-for-the-pine-barrens-treefrog-h\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report covers ongoing pine barrens
  treefrog research conducted at Carolina Sandhills NWR, and gives background information
  on past work, specifically that of Buchanan (2013). The report covers work from
  in May 2014 through August 2014, and consisted of six study sites. These sites consisted
  of two gas line right-of-way sites, two non right-of-way sites, and two sites where
  H. andersonii occurred historically but were not detected in 2012-2013. Researchers
  used automated acoustic recorders to document frog presence. The report includes
  data about the anuran species detections at each site and maps of study locations.\",\n\t\"license_title\":
